import {Table, Row, Col} from "react-bootstrap";
import Container from 'react-bootstrap/Container'
import { TextField } from '@material-ui/core';




const Table2 = () => {

  const [energy, setEnergy] = useState(0);

//   const [technology, setTechnology] = useState(0);
//   const [financialServices, setFinancialServices] = useState(0);
//   const [realEstate, setRealEstate] = useState(0);
//   const [pharmaceuticals, setPharmaceuticals] = useState(0);
//   const [airline, setAirline] = useState(0);
//   const [retail, setRetail] = useState(0);
//   const [gaming, setGaming] = useState(0);
//table

// () => setEnergy(energy + 1)
function onClickUpdate(status) {
    setEnergy(energy + 1);

}

  return (
    <div>
      <p>Investment Allocations</p>
        <Table>
            <thead>
                <tr>
                    <th> Asset Name </th>
                    <th> Minimum % </th>
                    <th> Dollars $ </th>
                    <th> Percentage % </th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td> Energy </td>
                    <td> Min % </td>
                    <td> Dollars $ </td>
                    <td> 
                        <TextField
                            id="energy-input"
                            label="Number"
                            type="number"
                            InputLabelProps={{
                                shrink: true,
                            }}
                            variant="outlined"
                        />
                    </td>
                </tr>
            </tbody>

        </Table>

      <p>You clicked {energy} times</p>
      <button onClick={onClickUpdate(status)}>
        Update!
      </button>
    </div>
  );

// total % is less than 100%, 
// each percent is > min
// instant conversion into dollars

};



export default Table2;


